webpackJsonp([378],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-getting-started-with-back-end-projects.json":function(t,e){t.exports={data:{markdownRemark:{html:'<p>The curriculum lead-up to the first Back End Project is not very comprehensive. Here are a number of common resources which other campers have found helpful.</p>\n<ul>\n<li><a>Introduction to Yeoman</a> - Lots of helpful tips and tricks for the Yeoman Angular Fullstack setup</li>\n<li><a href="https://github.com/DaftMonk/generator-angular-fullstack#generators">Angular Generator</a> - Generator used by Yeoman, you can find syntax and what files it creates</li>\n</ul>\n<h2>APIs</h2>\n<ul>\n<li>API for Charting the stock market: <a href="https://www.quandl.com/help/api">https://www.quandl.com/help/api</a></li>\n</ul>\n<h2>MEAN Stack Tutorials &#x26; Videos</h2>\n<ul>\n<li>5 Part Series on setting up a MEAN stack<br>\n<a href="https://www.youtube.com/watch?v=kHV7gOHvNdk">https://www.youtube.com/watch?v=kHV7gOHvNdk</a></li>\n<li>A MEAN tutorial that creates a simple Twitter clone<br>\n<a href="https://channel9.msdn.com/Series/MEAN-Stack-Jump-Start">https://channel9.msdn.com/Series/MEAN-Stack-Jump-Start</a></li>\n<li>Clementine is a stripped down MEAN stack, great for learning the fundamentals.<br>\n<a href="https://johnstonbl01.github.io/clementinejs/tutorials/tutorial-beginner.html">https://johnstonbl01.github.io/clementinejs/tutorials/tutorial-beginner.html</a></li>\n<li>Authentication with Passport for the MEAN stack:<br>\n<a href="https://vickev.com/#!/article/authentication-in-single-page-applications-node-js-passportjs-angularjs">https://vickev.com/#!/article/authentication-in-single-page-applications-node-js-passportjs-angularjs</a></li>\n<li>An amazing list of resources for learning the MEAN stack:<br>\n<a href="https://github.com/ericdouglas/MEAN-Learning">https://github.com/ericdouglas/MEAN-Learning</a></li>\n</ul>\n<h2>Scotch IO Tutorials</h2>\n<ul>\n<li><a href="https://scotch.io/tutorials/setting-up-a-mean-stack-single-page-application">https://scotch.io/tutorials/setting-up-a-mean-stack-single-page-application</a></li>\n<li><a href="https://scotch.io/tutorials/node-and-angular-to-do-app-application-organization-and-structure">https://scotch.io/tutorials/node-and-angular-to-do-app-application-organization-and-structure</a></li>\n</ul>\n<h2>Node/Express</h2>\n<ul>\n<li><a href="http://stackoverflow.com/a/16512303/1420506">Online Debugging for Node.js/Express</a></li>\n</ul>\n<h2>Cloud 9 Tricks</h2>\n<h3>Speed up browser reloads</h3>\n<ol>\n<li>Open gruntfile.js and edit both instances of <code>livereload: true</code> to <code>livereload: false</code>.</li>\n<li>Open server/config/express.js and comment out the line <code>app.use(require(\'connect-livereload\')());</code></li>\n</ol>',frontmatter:{title:"Getting Started with Back End Projects",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/getting-started-with-back-end-projects/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/getting-started-with-back-end-projects/"}}}});
